export default [
  {
    _tag: 'CSidebarNavItem',
    name: 'Acceuil',
    to: '/dashboard',
    icon: 'cil-home',
  },
  {
    _tag: 'CSidebarNavDropdown',
    name: 'A propos de nos services',
    route: '/base',
    icon: 'cil-puzzle',
    _children: [
      {
        _tag: 'CSidebarNavItem',
        name: 'site e-commerce',
        to: '/base/breadcrumbs',
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'site publicitaire',
        to: '/base/cards',
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Conception',
        to: '/base/carousels',
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Assistance',
        to: '/base/collapses',
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Gestion',
        to: '/base/forms',
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Infographie',
        to: '/base/jumbotrons',
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Maintenance',
        to: '/base/list-groups',
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Securité',
        to: '/base/navs',
      },
    ],
  },
  {
    _tag: 'CSidebarNavItem',
    name: 'Contacter nous',
    to: '/components/ContactUs',
    icon: 'cil-calculator',
  },
  {
    _tag: 'CSidebarNavItem',
    name: 'A propos nous',
    to: '/components/AboutUs',
    icon: 'cil-calculator',
  },
  {
    _tag: 'CSidebarNavItem',
    name: 'Blog',
    to: '/components/Blog',
    icon: 'cil-calculator',
  },
  {
    _tag: 'CSidebarNavDivider'
  },
  {
    _tag: 'CSidebarNavTitle',
    _children: ['Order'],
  },
  {
    _tag: 'CSidebarNavItem',
    name: 'Inscription',
    to: '/register',
    icon: 'cil-calculator',
  },
  {
    _tag: 'CSidebarNavItem',
    name: 'Connexion',
    to: '/login',
    icon: 'cil-calculator',
  },
  {
    _tag: 'CSidebarNavItem',
    name: 'Favorites',
    to: '/widgets',
    icon: 'cil-calculator',
  },
  {
    _tag: 'CSidebarNavDivider',
    className: 'm-2'
  }
]
